import profileReducer from "./profile-reducer";
import CarReducer from "./car-reducer";
import DataReducer from "./data-reduser";

let store = {
    _state: {
        profileData: {
            dialogsData: [
                {id: 1, name: 'Dima'},
                {id: 2, name: 'Andre'},
                {id: 3, name: 'Sasha'},
            ],
            messagesData: [
                {id: 1, message: 'hi'},
                {id: 2, message: 'hi'},
                {id: 3, message: 'hi'},
                {id: 4, message: 'hi'},
            ],
        },
        profilePage: {
            posts: [
                {id: 1, message: 'hi'},
                {id: 2, message: 'ho'}
            ],
            newPostText: ' re',
        },
        profileCar: {
            messagesCar: [
                {id: 1, message: 'BMW'},
            ],
            newPostCar: ' ',
        },
    },
    _callSubscriber() {
        console.log('state is change');
    },
    getState() {
        return this._state;
    },
    subscribe(observer) {
        this._callSubscriber = observer;
    },
    dispatch(action) {

        this._state = profileReducer(this._state, action);
        this._state = CarReducer(this._state, action);
        this._state = DataReducer(this._state, action);


        this._callSubscriber(this._state);

    }
}

export default store;
window.state = store;
